import React from 'react';

const HistoryItem = ({ item }) => {
  return (
    <div className="border p-4 rounded-md shadow-sm my-2">
      <h4 className="font-semibold text-lg">{item.type.toUpperCase()}</h4>
      <p><strong>Ngày:</strong> {new Date(item.date).toLocaleDateString()}</p>
      <p><strong>Chi tiết:</strong> {item.details}</p>
    </div>
  );
};

export default HistoryItem;
